// SPDX-License-Identifier: MIT
/** @title Broker */
/** @author Zergity */

pragma solidity >=0.6.2;
pragma experimental ABIEncoderV2;

import '@uniswap/lib/contracts/libraries/TransferHelper.sol';
import "./interfaces/IERC20.sol";
import "./interfaces/IWETH.sol";
import './interfaces/IUniswapV2Pair.sol';
import './interfaces/IUniswapV2Router02.sol';
import './interfaces/IAggregator.sol';

contract Broker is IAggregator {
    event Fill(bytes32 indexed slot, uint256 amountOut, uint256 deadline);
    event GC(bytes32 indexed slot);

    address private constant COIN = 0xEeeeeEeeeEeEeeEeEeEeeEEEeeeeEeeeeeeeEEeE;
    address private constant WCOIN = 0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;

    bytes32 private constant DOMAIN_SEPARATOR = 0x979307752a88d4f0ad6e454fdfd30ae51ff1e7f90ccd30e6e0a8ff8c295e6bfc;
    address private constant AGGREGATOR = 0x9a7b42f2cC543ab1bcFEB2b9F8b9cB8CC0F38E5F;

    mapping(bytes32 => uint) filled;

    function cancel(
        bytes32 digest,
        uint    deadline
    ) external {
        require(block.timestamp <= deadline, "Broker: EXPIRED");
        bytes32 slot = _toSlot(digest, msg.sender, deadline);
        require(filled[slot] == 0, "Broker: INVALIDATED");
        emit Fill(slot, 0, deadline);
    }

    struct ___ {
        address maker;
        uint amountOut;
        uint spentAmount;
        bytes32 slot;
    }

    function fill(
        SignedOrder calldata    order,
        Route[]     calldata    routes,
        address                 referrer,
        bytes32                 expiredSlot // optional expired slot to be garbage collected
    ) external returns (uint profit) {
    unchecked {
        require(block.timestamp <= order.deadline, "Broker: EXPIRED");
        ___ memory __;
        (__.slot, __.maker) = _updateOrderSlot(order);

        // (uint amountOut,) = IAggregator(AGGREGATOR).aggregate(order, routes, payable(address(this)), referrer);
        __.amountOut = order.tokenOut == COIN ? 0 : IERC20(order.tokenOut).balanceOf(msg.sender);

        for (uint i; i < routes.length; ++i) {
            // direct transfer tokenIn from order maker
            TransferHelper.safeTransferFrom(order.tokenIn, __.maker, routes[i].steps[0][2], routes[i].amount);
            for (uint j; j < routes[i].steps.length; ++j) {
                _swapSupportingFeeOnTransferTokens(routes[i].steps[j]);
            }
            __.spentAmount += routes[i].amount;
        }
        require(__.spentAmount == order.amountIn, "Broker: spentAmount != amountIn");

        if (order.tokenOut == COIN) {
            __.amountOut = IERC20(WCOIN).balanceOf(address(this));
            require(__.amountOut >= order.amountOutMin, 'Broker: INSUFFICIENT_OUTPUT_AMOUNT');
            IWETH(WCOIN).withdraw(__.amountOut);
            TransferHelper.safeTransferETH(__.maker, order.amountOutMin);
            profit = __.amountOut - order.amountOutMin;
            if (profit > 0) {
                TransferHelper.safeTransferETH(msg.sender, profit);
            }
        } else {
            uint balance = IERC20(order.tokenOut).balanceOf(msg.sender);
            require(balance >= __.amountOut, 'Broker: NEGATIVE_OUTPUT_AMOUNT');
            __.amountOut = balance - __.amountOut;
            require(__.amountOut >= order.amountOutMin, 'Broker: INSUFFICIENT_OUTPUT_AMOUNT');
            TransferHelper.safeTransferFrom(order.tokenOut, msg.sender, __.maker, order.amountOutMin);
            profit = __.amountOut - order.amountOutMin;
        }

        emit Swapped(
            msg.sender,
            order.tokenIn,
            order.tokenOut,
            __.maker,
            order.amountIn,
            __.spentAmount,
            __.amountOut,
            order.amountOutMin,
            referrer
        );

        emit Fill(__.slot, __.amountOut, order.deadline);

        if (expiredSlot != 0x0 &&
            filled[expiredSlot] != 0 &&
            filled[expiredSlot] < block.timestamp
        ) {
            delete filled[expiredSlot];
            emit GC(expiredSlot);
        }
    } }

    // **** SWAP (supporting fee-on-transfer tokens) ****
    // requires the initial amount to have already been sent to the first pair
    function _swapSupportingFeeOnTransferTokens(address[] memory path) internal {
        for (uint i = 1; i+3 < path.length; i += 2) {
            (address input, address output) = (path[i], path[i+2]);
            IUniswapV2Pair pair = IUniswapV2Pair(path[i+1]);
            uint amountOutput;
            { // scope to avoid stack too deep errors
                uint amountInput;
                {
                    (uint r0, uint r1,) = pair.getReserves();
                    uint ri = input < output ? r0 : r1;
                    amountInput = IERC20(input).balanceOf(address(pair)) - ri;
                }
                address[] memory tokens = new address[](2);
                tokens[0] = input;
                tokens[1] = output;
                amountOutput = IUniswapV2Router02(path[0]).getAmountsOut(amountInput, tokens)[1];
            }
            (uint amount0Out, uint amount1Out) = input < output ? (uint(0), amountOutput) : (amountOutput, uint(0));
            pair.swap(amount0Out, amount1Out, path[i+3], new bytes(0));
        }
    }

    function _balance(address token, address adr) internal view returns (uint) {
        return token == COIN ? adr.balance : IERC20(token).balanceOf(adr);
    }

    bytes32 public constant ORDER_TYPEHASH = keccak256("Order(address tokenIn,address tokenOut,uint256 amountIn,uint256 amountOut,uint256 deadline)");

    function _toSlot(bytes32 digest, address maker, uint deadline) internal pure returns (bytes32) {
        return keccak256(abi.encodePacked(digest, maker, deadline));
    }

    function _toDigest(
        address tokenIn,
        address tokenOut,
        uint    amountIn,
        uint    amountOutMin,
        uint    deadline
    ) internal pure returns (bytes32 digest) {
        return keccak256(abi.encodePacked(
            '\x19\x01',
            DOMAIN_SEPARATOR,
            keccak256(abi.encode(ORDER_TYPEHASH, tokenIn, tokenOut, amountIn, amountOutMin, deadline))
        ));
    }

    function _recover(
        SignedOrder memory order
    ) internal pure returns (bytes32 slot, address maker) {
        bytes32 digest = _toDigest(order.tokenIn, order.tokenOut, order.amountIn, order.amountOutMin, order.deadline);
        maker = ecrecover(digest, order.v, order.r, order.s);
        require(maker != address(0), 'Broker: INVALID_SIGNATURE');
        slot = _toSlot(digest, maker, order.deadline);
    }

    function _updateOrderSlot(SignedOrder memory order) internal returns (bytes32 slot, address maker) {
        (slot, maker) = _recover(order);
        require(filled[slot] == 0, "Broker: INVALIDATED");
        filled[slot] = order.deadline;
    }

    function parseOrder(SignedOrder calldata order) external view returns (
        bytes32 digest,
        address maker,
        bytes32 slot,
        uint    status
    ) {
        digest = _toDigest(order.tokenIn, order.tokenOut, order.amountIn, order.amountOutMin, order.deadline);
        if (order.v != 0 && order.r != 0 && order.s != 0) {
            maker = ecrecover(digest, order.v, order.r, order.s);
            slot = _toSlot(digest, maker, order.deadline);
            status = filled[slot];
        }
    }
